"use strict";


import React, {useEffect, useState} from 'react';
import UserDialog from "./UserDialog";
import {makeStyles} from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CourseOverviewComponent from "../CourseOverview/CourseOverviewComponent";
import {UserService} from "../../services/UserService";
import CourseCard from "../CourseOverview/CourseCard";
import Typography from "@material-ui/core/Typography";

const useStyles = makeStyles((theme) => ({
    headerImg: {
        objectFit: 'cover',
        height: '280px',
        width: '100%',
    },
    userBox: {
        marginTop: "1em",
        textAlign: 'center',
    },
    paddingUserbox: {
        padding: "12px",
        maxWidth: "500px",
        margin: "auto",
        marginTop: "25px",
    },
    courseContainer: {
        marginTop: '25px',
        display: 'grid',
        gridTemplateColumns: 'repeat(12, minmax(auto, 1fr))',
        gridGap: '40px',
        [theme.breakpoints.down('md')]: {
            gridGap: '30px',
        },
        [theme.breakpoints.down('xs')]: {
            gridGap: '16px',
        },
    },
    content: {
        padding: '30px 60px',
        maxWidth: '1800px',
        margin: '0 auto',
        [theme.breakpoints.down('md')]: {
            padding: '30px',
        },
        [theme.breakpoints.down('xs')]: {
            padding: '16px',
            margin: '0',
        },
    },
}));

export default function User(props) {

    const classes = useStyles()

    const [title, setTitleData] = useState("");
    const [firstname, setFNameData] = useState("");
    const [lastname, setLNameData] = useState("");
    const [streetname, setStreetData] = useState("");
    const [streetnr, setStreetNrData] = useState("");
    const [plz, setPLZData] = useState("");
    const [city, setCityData] = useState("");
    const [country, setCountryData] = useState("");
    const [restaurantName, setRestaurantNameData] = useState("");
    const [homepage, setHomepageData] = useState("");
    const [triggerUpdate, setTriggerUpdate] = useState(false);

    const updateCustomer = (user) => {
        UserService.updateCustomer(user).then(res =>
            setTriggerUpdate(!triggerUpdate)
        );
    };

    useEffect(
        () => {
            const fetchData = () => {
                UserService.getUser(UserService.currentUserValue.id).then(res => {
                    setTitleData(res.data.title)
                    setFNameData(res.data.firstName)
                    setLNameData(res.data.lastName)
                    setStreetData(res.data.streetname)
                    setStreetNrData(res.data.houseNumber)
                    setPLZData(res.data.zipCode)
                    setCityData(res.data.city)
                    setCountryData(res.data.country)

                    if (UserService.isAuthenticated() && UserService.currentUserValue.isChef) {
                        setRestaurantNameData(res.data.restaurantName)
                        setHomepageData(res.data.homepage)
                    }


                }).catch(err => {
                    console.log(err);
                });
            }
            fetchData()
        },
        [triggerUpdate]
    )

    return (
        <React.Fragment>
            <img className={classes.headerImg}
                 src="data:image/jpeg;base64,"
                 alt="CourseImage"/>
            <div className={classes.content}>
                <Typography component="h4" variant="h4" className={`${classes.userBox}`}>Your Information</Typography>
                <Card className={`${classes.userBox} ${classes.paddingUserbox}`}>
                    <div><b>Name:</b> {title} {firstname} {lastname}</div>
                    <div><b>Address:</b> {streetname} {streetnr}</div>
                    <div><b>City:</b> {plz} {city}</div>
                    <div><b>Country:</b> {country}</div>
                    <p/>
                    {UserService.isAuthenticated() && UserService.currentUserValue.isChef ?
                        <div>
                            <div>{restaurantName}</div>
                            <div>{homepage}</div>
                            <p/>
                        </div>
                        : null}

                    <UserDialog
                        onSubmit={(user) => updateCustomer(user)}
                    />
                    <p/>
                </Card>
                <Typography component="h4" variant="h4" className={classes.userBox}>Your Courses</Typography>
                {props.courses.data.length === 0
                    ?
                    <React.Fragment>
                        {UserService.isAuthenticated() && UserService.currentUserValue.isChef ?
                            <Typography component="h5" variant="h5">You have not created a course yet. Click
                                on
                                create course to create your first course!</Typography>
                            : <Typography component="h5" variant="h5">You have not booked any courses yet.
                                Click
                                on courses to find a cooking course for
                                you!</Typography>
                        }
                    </React.Fragment>
                    : <div className={classes.courseContainer}>
                        {props.courses.data.map(course => (
                            <CourseCard key={course.courseId + "_" + course.instanceId} id={course.courseId}
                                        instance_id={course.instanceId}
                                        courseTitle={course.courseTitle} courseImage={course.courseImage}
                                        startDate={course.startDate}
                                        costs={course.cost}/>
                        ))}
                    </div>
                }
            </div>
        </React.Fragment>

    );

}
